TEST_F(UtestFormatTransferNchwFz, build_transfer_fp32) {
  float data[17 * 31 * 5 * 5];
  TransArgs args{
      reinterpret_cast<uint8_t *>(data),     FORMAT_NCHW, FORMAT_FRACTAL_Z, std::vector<int64_t>({17, 31, 5, 5}),
      std::vector<int64_t>({50, 2, 16, 16}), DT_FLOAT};
  auto transfer = BuildFormatTransfer(args);
  EXPECT_NE(transfer, nullptr);
}

